import React from 'react';
import Jumbotron from 'react-bootstrap/Jumbotron'
import video from './videos/dna2.mp4'
import './App.css';

const Video = () => {
  return (
    <div className="container">
      <video autoPlay playsInline muted src={video} />
    </div>
  );
};
function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Jumbotron>
          <h1>Bioinformatics:
            <p3> Learning Tools</p3>
          </h1>
          <Video />
          </Jumbotron>
      </header>
    </div>

  );
}

export default App;
